  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0130657 includes physical
  and profile data collected aboard the FAIRWEATHER during project OPR-N324-FA-10
  in the Coastal Waters of SE Alaska and North Pacific Ocean from 2010-06-02 to 2010-06-29.
  These data include CONDUCTIVITY, HYDROSTATIC PRESSURE, SALINITY, SOUND VELOCITY,
  WATER DENSITY and WATER TEMPERATURE. The instruments used to collect these data
  include CTD and sound velocimeter - moving vessel profiler. These data were collected
  and submitted by the NOAA Office of Coast Survey in support of hydrographic multibeam
  surveys to meet NOAA charting requirements.\",\n\t\"license_title\": \"License Not
